var Stage = function () {
  function Stage() {
    _classCallCheck(this, Stage);

    this.MAX = 1;
    this.DIFFICULTY_MAX = 2.0;
    this.no = 1;
    this.privateNo = 0;
    this.difficulty = 1;
  }

  _createClass(Stage, [{
    key: 'reset',
    value: function reset() {
      this.no = 1;
      this.privateNo = 0;
      this.difficulty = 1;
    }
  }, {
    key: 'advance',
    value: function advance() {
      this.no++;
      this.privateNo++;

      if (this.difficulty < this.DIFFICULTY_MAX) {
        this.difficulty += 0.05;
      }

      if (this.privateNo >= this.MAX) {
        this.privateNo = 0;
      }
    }
  }]);

  return Stage;
}();

