function game() {
  // タスクの呼び出し
  // メインに描画
  if (start) {
    requestAnimationFrame(game);
  }

  if (!isHidden) {
    try {
      tasks.checkSort();
      var arr = tasks.getArray();
      for (var i = 0; i < arr.length; ++i) {
        var task = arr[i];
        if (task != util.nullTask) {
          task.func(task.index);
        }
      }
      tasks.compress();
    } catch (e) {
      ExitError(e);
    }
  }
};

